 @israelpascoaleufrazio702  cara, você pode fazer o que quiser, mas não sendo um rival de estado ou até nacional (por exemplo, imagino que o Inter tenha alguma rivalidade com o SPFC, talvez, sei lá) não vejo porque torcer contra, mas se quiser torcer contra OK.

O Cruzeiro é um dos 12 grandes, e esse ano estamos tendo os 12 grandes na série A, o que é muito bom porque sempre tem jogo bom, a bilheteria/audiência são altas e o campeonato é mais comentado, ou seja, times grandes e com as maiores torcidas só melhora o campeonato.

A gente zoar e sacaneia um rival ou um grande que cai, blz, é da brincadeira, mas pro campeonato é muto melhor quando os grandes jogam entre si.

 @israelpascoaleufrazio702  cara, a zoeira é valida, quando acontecer de um time cair, bora sacanear. Você pode até torcer contra quem não é seu rival, tipo quem é "anti-flamengo" mesmo não sendo do RJ.

Enfim, tudo isso é comum, agora, vamos supor que eu não goste nem do Inter e nem do Grêmio, e daí quero que os dos caiam. Posso até ficar feliz se acontecer, mas isso é péssimo pro futebol brasileiro comum um todo, pois são 2 jogos a menos para os outros times contra os 2 grandes do Sul.

Enfim, em algum momento algum grande cai, e, quando acontece, pode zuar à vontade! Porém, é bem melhor quando eles estão na 1ª divisão, inclusive o seu rival, o Grêmio, pois, quanto mais jogos vocês faz contra eles, melhor é o boca a boca, maior a rivalidade, o sul para pra ver, enfim, o Grêmio ter ficado na série B ano passado foi bom só pela zueira, mas em questão financeira e midiática, pro Inter é péssimo.

 @eduardogames5240  aí, amigo, eu respeto que você queria que seu time continue na série A, mas eu prefiro mil vezes o Cruzeiro na A do que o América-MG.

Até o próprio Galo prefere fazer 2 jogos no Brasileirão contra o Cruzeiro, pois é clássico e gera mais receita e mídia.

"Ah mas quando caiu todo mundo ficou feliz e riu", sim, mas é ruim pro produto futebol brasileiro que algum dos grandes caia.

 @rodriguesgomes4178  O Botafogo está jogando melhorzinho esse ano, está liderando o brasileiro, mas essa liderança vai cair, o palmeiras já chegou e os qe vem atrás Tbm
O qe vc tem qe entender, é qe o Cuiabá é um clube novo, com um poder financeiro muito inferior a esses grandes, os jogadores são medianos, É óbvio qe se eles fizerem um gol, vão se fechar pra assegurar o resultado, pqe ñ tem como competir com qem tem Anos de história, com um poder financeiro super alto, com jogadores de qualidade
É melhor ganhar de 1 x 0 do qe nada

